import { Component } from 'react';
import './App.css';

import Handlebars from "handlebars";

const html = `<div id="board">
                {{#each cells}}\
                  {{#if link}}\
                    <a href={{link}}><div class="cell {{clazz}}">{{text}}</div></a>\
                  {{else}}\
                    <div class="cell {{clazz}}">{{text}}</div>\
                  {{/if}}\
                {{/each}}\
              </div>\
              <div id="bottombar">\
                <a href="/newgame"><button>New Game</button></a>\
                <button>Undo</button>\
              </div>`;
const template = Handlebars.compile(html);


interface AppState {
  state: string
};

async function newGame() {
  const response = await fetch('/newgame');
  console.log("WHYYYY NOTTT");
  return await response.json();
}

class App extends Component<{}, AppState> {
  newGame = () => {
    newGame().then(res => console.log(res))
  }
  render() {
    console.log("HELLO");
    return (
      <div className="App">
        <div dangerouslySetInnerHTML={{ __html: template(this.state) }} />
      </div>
    );
  }
}

export default App;
